import React from "react";
class Header extends Component{
 render() {
        <div>
            <ul>
                <li><a href="">Home</a></li>
                <li><a href="">About</a></li>
                <li><a href="">Contact</a></li>
                <li><a href="">Product</a></li>
                <li><a href="">My Account</a></li>
            </ul>
        </div>
 }
}
export default Header;
